import React from 'react';
import Clock from 'react-live-clock';

export default function LiveClock() {
  return (
    <p>
      It's <Clock format={"HH:mm:ss"} ticking={true}/> right now, what are you up to? <span>✏️</span>
    </p>
  )
}
